import React, { ReactElement } from "react";

interface StockResultProps {
    ticker: string
    price: string
}

function StockResultDisplay({props}: React.PropsWithChildren<StockResultProps>):ReactElement {
    console.log(`in the display comp it is ${props.price}`)
    if (props.ticker && props.price) {
        console.log("im returning!")
        return(
            <tr>
                <td>{props.ticker}</td>
                <td>price is {props.price}</td>

            </tr>
        )
    } else {
        return <div></div>
    }
}


export default StockResultDisplay;
